Dirk Pitt heeft zojuist tot zijn schrik ontdekt dat hij twee volwassen kinderen heeft. Ze werken voor het onderwaterstation van de NUMA, voor de kust van Nicaragua. Als zijn dochter Summer, een zeebiologe, en zijn zoon Dirk jr., een scheepswerktuigkundige, de oorsprong van een bruine smurrie die de oceaan teistert proberen vast te stellen, worden ze bedreigd door een woeste storm. Die koerst niet alleen hun kant uit maar is ook op weg naar een luxueus, drijvend hotel. Met de rest van de NUMA-ploeg wagen Pitt en Al Giordino een wanhopige reddingspoging. Maar wat ze in het kielzog van de storm aantreffen, doet het natuurgeweld verbleken. In het Caribisch gebied is blijkbaar een maar al te menselijk kwaad aan het werk.
